import logo from './logo.svg';
import './App.css';
import React from 'react';
import Pokemon, {IPokemon} from "./components/pokemon/pokemon";

class App extends React.Component {
    constructor() {
        super()
        this.state = {
            pokemon: undefined
        }
    }
    render() {
        return (
            <div className="App">
                <header className="App-header">
                </header>
                <input type="text" placeholder="Write a Pokemon name"/>
                <Pokemon />
            </div>
        );
    }
}

export default App;
